script: |
  super -f text -I q13538.spq | sort > q13538.out

inputs:
  - name: q13538.spq
    data: |
      SELECT ALL col1 AS col1 FROM tab0 (FORMAT parquet) WHERE NOT col2 * ( + - col0 ) * + ( col2 ) * + 91 + ( 14 ) >= col2 * - - col2 + col0;
  - name: tab0

outputs:
  - name: q13538.out
    data: |
      1
      21
      81
